import Form from "./Form";
import Tasks from "./Tasks";
import HeadlineButtons from "./HeadlineButtons";
import Section from "./Section";

const tasks = [
  { id: 1, content: "robic reacta", done: false },
  { id: 2, content: "grac w gierki", done: true },
];

const hideDoneTasks = [];

function App() {
  return (
    <main className="main">
      <header>
        <h1>
          Lista zadań
        </h1>
      </header>
      <Section title="Dodaj nowe zadanie" body={<Form key={tasks.id} />} />


      <section className="section">
        <header>
          <h2 className="section__headline">
            Lista zadań
            <HeadlineButtons key={tasks.id} tasks={tasks} hideDoneTasks={hideDoneTasks} />
          </h2>
        </header>
        <div>
          <Tasks key={tasks.id} tasks={tasks} hideDoneTasks={hideDoneTasks} />
        </div>

      </section>
    </main>
  );
}

export default App;
